PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE clientes (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    nome TEXT,
    email TEXT,
    telefone TEXT,
    tem_whatsapp BOOLEAN DEFAULT 0,
    status TEXT DEFAULT 'ativo' CHECK(status IN ('ativo', 'inativo')),
    fez_contato BOOLEAN DEFAULT 0,
    data_contato TEXT,
    observacoes TEXT,
    data_criacao DATETIME DEFAULT CURRENT_TIMESTAMP,
    data_atualizacao DATETIME DEFAULT CURRENT_TIMESTAMP
  , empresa TEXT, vale_pena_contato BOOLEAN DEFAULT 0);
CREATE INDEX idx_status ON clientes(status);
CREATE INDEX idx_whatsapp ON clientes(tem_whatsapp);
CREATE INDEX idx_contato ON clientes(fez_contato);
CREATE INDEX idx_empresa ON clientes(empresa);
CREATE INDEX idx_nome ON clientes(nome);
CREATE INDEX idx_vale_pena ON clientes(vale_pena_contato);
COMMIT;
